import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import RestorantCreate from './components/RestorantCreate';
import RestorantUpdate from './components/RestorantUpdate';
import RestorantDelete from './components/RestorantDelete';
import RestorantDetail from './components/RestorantDetail';
import RestorantList from './components/RestorantList';
import RestorantSearch from './components/RestorantSearch';
import Home from './components/Home';
import {Navbar,Nav} from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar bg="light" expand="lg">
          <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Link id="RouterNavLink" style={null} to="/">Home</Link>
              <Link id="RouterNavLink" style={null} to="/list">List</Link>
              <Link id="RouterNavLink" style={null} to="/create">Create</Link>
              <Link id="RouterNavLink" style={null} to="/search">Search</Link>
              <Link id="RouterNavLink" style={null} to="/update">Update</Link>
              <Link id="RouterNavLink" style={null} to="/delete">Delete</Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        <Route exact path='/'>
          <Home />
        </Route>
        <Route path='/create'>
          <RestorantCreate />
        </Route>
        <Route path='/update'>
          <RestorantUpdate />
        </Route>
        <Route path='/list'>
          <RestorantList />
        </Route>
        <Route path='/detail'>
          <RestorantDetail />
        </Route>
        <Route path='/search'>
          <RestorantSearch />
        </Route>
        <Route path='/delete'>
          <RestorantDelete />
        </Route>
      </Router>
    </div>
  );
}

export default App;
